import React, { Component } from 'react'

export default class Record extends Component {
  render() {
    const { record_id, skill_id, skill_title, skill_icon, emotion_id, before_lvl, after_lvl, impact, date, si, sh} = this.props.record;
    return (
      <div>
          <div className="skill">
          {date} - {si} {sh}
               {emotion_id} : {skill_title} ({impact})  
             </div>
      </div>
    )
  }
}
